oxy_webhelp_navlinks = {"main_interface_introduction-d895e189":{"topics":[{"title":"3.1.1 导航窗口","shortdesc":"<p class=\"shortdesc\">导航窗格位于界面左侧，您可以经此快速访问不同的文献库和分组。<\/p>","href":"3zotero界面概述\/zotero_navigation_pane.html","attributes":{"data-id":"zotero_navigation_pane_0"},"menu":{"hasChildren":false},"tocID":"zotero_navigation_pane_0-d895e200","topics":[]},{"title":"3.1.2 文献库","shortdesc":"<p class=\"shortdesc\">文献库是管理和存储所有文献资料的核心区域。这里汇集了您收集的所有文献条目，包括书籍、期刊文章、会议论文等。<\/p>","href":"3zotero界面概述\/zotero_library.html","attributes":{"data-id":"zotero_library"},"menu":{"hasChildren":false},"tocID":"zotero_library-d895e211","topics":[]},{"title":"3.1.3 右侧面板（文献详情）","shortdesc":"<p class=\"shortdesc\">右侧面板是显示文献详细信息的区域。当您在文献库中选中一个具体文献条目时，右侧面板会展示该文献的详细资料和附加信息。<\/p>","href":"3zotero界面概述\/right_panel.html","attributes":{"data-id":"right_panel"},"menu":{"hasChildren":false},"tocID":"right_panel-d895e222","topics":[]}]}};